import React from 'react'


function ListElement(){
    return(
        <div className="left-content">
            <ul className="ul-left-content">
                <li className="li-left-content-active"><img className="dash-icon" src={SplitIcon} /><a className="text-left-nav" href="">Dashboard</a></li>
                <li className="li-left-content"><img className="flag-icon" src={FlagIcon} /><i className="flag-icon"></i><a className="text-left-nav" href="">Recent Activity</a></li>
                <li className="li-left-content"><img className="menu-icon" src={MenuIcon} /><a className="text-left-nav" href="">All Expenses</a></li>
            </ul>

        </div>
    )
}

export default LeftContent
